import React from 'react';
import './counter.styles.scss';

class Counter extends React.Component {
    constructor(){
        super()

        this.state=null;
    }

    render(){
        return(
            <div className='wrap'>
            
                <div className='counter'></div>
            
            </div>

        )
    }
}

export default Counter;
